/* Trap handler: determine what cuase the interrupt and calls
the appropriate subroutine. */
void handler(void) {
    int mcause_value;
    __asm__ volatile ("csrr %0, mcause" : "=r" (mcause_value));
     // software interrupt
    if (mcause_value == 0x80000003) {
        SWI_ISR(); 
        
    }
    // machine timer
    else if (mcause_value == 0x80000007) { 
        mtimer_ISR(); 
    
    } 
    // interval timer
    else if (mcause_value == 0x80000010) {
        itimer_ISR(); 
    }

    // push-key interrupt
    else if (mcause_value == 0x80000012) { 
        KEY_ISR(); 
        
    }
    // Audio 
    else if (mcause_value == 0x80000015) {
        AUDIO_ISR(); // AUDIO 
    }
    
    else if(mcause_value == 0x80000016) {
        PS2_ISR();

    }

    // else, ignore the trap

}

// software interrupt service routine
void SWI_ISR(void) {
    volatile int *mtime_ptr = (int *)(MTIME_BASE);
    counter = 0b1111111100;
    *(mtime_ptr + 4) = 0;

    return;
}

// NIOS V machine timer interrupt service routine
typedef long long int64;

void mtimer_ISR(void) {
    volatile unsigned int *mtime_ptr = (unsigned int *)(MTIME_BASE);
    int64 mtimecmp64;

    mtimecmp64 = *(mtime_ptr + 3); // read high word of 64-bit register
    mtimecmp64 = (mtimecmp64 << 32) | *(mtime_ptr + 2); // read low word
    mtimecmp64 = mtimecmp64 + (int64)(QUARTER_CLOCK); // adjust timeout
    *(mtime_ptr + 2) = (unsigned int)(mtimecmp64); // store low word
    *(mtime_ptr + 3) = (unsigned int)(mtimecmp64 >> 32); // store high word
    counter += 1;

    return;
}

// FPGA interval timer interrupt service routine
void itimer_ISR(void) {
    int new_digit;
    volatile int *timer_ptr = (int *) TIMER_BASE;
    *timer_ptr = 0;
    new_digit = digit + KEY_dir;
    if (new_digit < 10 && new_digit > -1) digit = new_digit;

    return;
}

// KEY port interrupt service routine
void KEY_ISR(void) {
    int pressed;
    volatile int *KEY_ptr = (int *) KEY_BASE;
    pressed = *(KEY_ptr + 3);
    *(KEY_ptr + 3) = pressed;
    KEY_dir = -KEY_dir;

	colour_index++;

    return;
}

