// configure the NIOS V machine timer
void set_mtimer(void) {
    volatile int *mtime_ptr = (int *) MTIME_BASE;
    unsigned int mtime_h, mtime_l, carry, mtimecmp_l;
    do {
        mtime_h = *(mtime_ptr + 1); // read mtime high word
        mtime_l = *(mtime_ptr); // read mtime low word
    } while (*(mtime_ptr + 1) != mtime_h);

    mtimecmp_l = mtime_l + QUARTER_CLOCK; // add to current time
    carry = (mtimecmp_l < mtime_l) ? 1 : 0; // check for carryout
    *(mtime_ptr + 2) = mtimecmp_l; // set mtimecmp low word
    *(mtime_ptr + 3) = mtime_h + carry; // set mtimecmp high word

    return;
}

// configure the FPGA inrerval timer
void set_itimer(void) {
    volatile int *timer_ptr = (int *) TIMER_BASE;
    // set the interval timer period
    int load_val = CLOCK_RATE;
    *(timer_ptr + 0x2) = (load_val & 0xFFFF);
    *(timer_ptr + 0x3) = (load_val >> 16) & 0xFFFF;

    // start interval timer, enable its interrupts
    *(timer_ptr + 1) = 0x7;

    return;
}

// configure the KEY port
void set_KEY(void) {
    volatile int *KEY_ptr = (int *) KEY_BASE;
    *(KEY_ptr + 3) = 0xF;
    *(KEY_ptr + 2) = 0xF;

    return;
}


void plot_pixel(int x, int y, short int line_color)
{
    volatile short int *one_pixel_address;
        
	one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);

	*one_pixel_address = line_color;
}


void clear_screen() {
	// Draw the bitmap on the VGA display
    for (int y = 0; y < BITMAP_HEIGHT; y++) {
        for (int x = 0; x < BITMAP_WIDTH; x++) {
            uint16_t color = bitmap_data[y * BITMAP_WIDTH + x];
            write_pixel_to_vga(x, y, color);
        }
    }
}

void wait_for_vsync() {
	 volatile int * pixel_ctrl_ptr = (int *)0xFF203020;

	// Write 1 into the buffer
	*(pixel_ctrl_ptr) = 0b1;

	int status = *(pixel_ctrl_ptr + 3);
	status = status & 0b1;
	// Wait until status bit is 0

	while (status != 0) {
		status = *(pixel_ctrl_ptr + 3);
		status = status & 0b1;

	}
}


void draw_line(int x0, int y0, int x1, int y1, int colour) {
	int is_steep = abs(y1-y0) > abs(x1 - x0); 
	if (is_steep) {
		int temp = x0;
		x0 = y0;
		y0 = temp;
		
		temp = x1;
		x1 = y1;
		y1 = temp;	
	}
	
	if (x0 > x1) {
		int temp = x0;
		x0 = x1;
		x1 = temp;
		
		temp = y1;
		y1 = y0;
		y0 = temp;
		
	}
	
	int deltax = x1 - x0;
	int deltay = abs(y1 - y0);
	int error = -(deltax / 2);
	int y = y0;
	
	
	int y_step = -1;
	if (y0 < y1) {
		y_step = 1;
	}
	
	// Iterate through all x values
	for (int i = x0; i <= x1; ++i) {
		if (is_steep) {
			plot_pixel(y, i, colour);	
		}
		else {
			plot_pixel(i, y, colour);
		}
		
		error += deltay;
		if (error > 0) {
			y += y_step;
			error -= deltax;
		}
		
		
	}
	
}

void draw_box(int width, int height, int x, int y, int colour) {
	if (height < 0) { 
		height *= -1;
	
	}
	
	for (int i = 0; i < height; ++i) {
		draw_line(x, y - i, x + width, y - i, colour);	
	}
}

